import React from 'react';
import { Link } from 'react-router-dom';

const PostItem = ({ post }) => (
  <div>
    <h2>{post.title}</h2>
    <p>{post.content}</p>
    <button>
      <Link to={`/edit/${post.id}`}>Edit</Link>
    </button>
  </div>
);

export default PostItem;
